import React from 'react';
import { useNavigate } from 'react-router-dom';

const Navbar = ({ username, handleLogout }) => {
    const navigate = useNavigate();

    return (
        <header className="bg-gray-800 text-white fixed w-full top-0 left-0 z-10">
            <div className="container mx-auto flex justify-between items-center py-4 px-8">
                {/* Logo */}
                <div className="text-2xl font-bold cursor-pointer" onClick={() => navigate('/')}>
                    LOGO
                </div>

                {/* Navigation Links */}
                <nav className="space-x-8">
                    <button onClick={() => navigate('/')} className="hover:text-gray-400">Home</button>
                    <button onClick={() => navigate('/about')} className="hover:text-gray-400">About</button>
                    <button onClick={() => navigate('/contact')} className="hover:text-gray-400">Contact Us</button>
                </nav>

                {/* User Info & Logout */}
                {username && (
                    <div className="flex items-center space-x-4">
                        <span>Welcome, {username}</span>
                        <button onClick={handleLogout} className="bg-red-500 hover:bg-red-600 text-white px-4 py-2 rounded">Logout</button>
                    </div>
                )}
            </div>
        </header>
    );
};

export default Navbar;
